import Vue from 'vue';
import App from './App.vue';
import 'vue-material/dist/vue-material.min.css';
import { MdList, MdIcon, MdSwitch } from 'vue-material/dist/components';

Vue.use(MdList);
Vue.use(MdIcon);
Vue.use(MdSwitch);
Vue.use(MdList);

Vue.config.productionTip = false

Vue.component('edulynxOverview', require('./components/EDULYNX-Overview.vue'));

new Vue({
  render: h => h(App)
}).$mount('#app')
